using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Data;
using System.Drawing;
using System.Linq;
using System.Security.Cryptography;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Forms;

namespace DeggCryptor
{
    public partial class MainForm : Form
    {
        private string encryptedEgg = "";

        public MainForm()
        {
            InitializeComponent();
        }

        private void MainForm_Load(object sender, EventArgs e)
        {

        }

        private void Button_Click(object sender, EventArgs e)
        {
            try
            {
                string key = KeyGen.generateKey();
                System.IO.MemoryStream streamBitmap = new System.IO.MemoryStream(AesHelper.Decrypt(Convert.FromBase64String(encryptedEgg), key));
                Bitmap bitImage = new Bitmap((Bitmap)Image.FromStream(streamBitmap));
                pictureBox.Image = bitImage;
            }
            catch (Exception) { }
        }
    }
}
